    const handleFullscreen = () => {
      const elem = document.documentElement;
    
      if (!document.fullscreenElement &&    // Standard
          !document.webkitFullscreenElement && // Safari
          !document.msFullscreenElement) {     // IE11
        // Enter fullscreen
        if (elem.requestFullscreen) {
          elem.requestFullscreen();
        } else if (elem.webkitRequestFullscreen) {
          elem.webkitRequestFullscreen();
        } else if (elem.msRequestFullscreen) {
          elem.msRequestFullscreen();
        }
      } else {
        // Exit fullscreen
        if (document.exitFullscreen) {
          document.exitFullscreen();
        } else if (document.webkitExitFullscreen) {
          document.webkitExitFullscreen();
        } else if (document.msExitFullscreen) {
          document.msExitFullscreen();
        }
      }
    };

    const handleInputChange = (e) =>{
        const value = e.target.value;
        console.log(query);
         
        if(value){
            const filteredSuggestion = Object.keys(buildingFloors).filter((item)=>
              item.toLowerCase().includes(value.toLowerCase())
            );
            setSuggestion(filteredSuggestion);
            filteredSuggestion.length === 0 ? setQuery(value) : setQuery(filteredSuggestion);
        }else{
            setSuggestion([]);
            setQuery([]);
        }
   }

   const handleSuggestionClicked = (suggestion) =>{
        setQuery(suggestion);
        const input = document.querySelector('input[type="search"]');
        if (input) {
            input.value = suggestion;
        }
        console.log(suggestion)
        setSuggestion([]);
   }
  
   const MAX_ZOOM_OUT_LEVEL = 1;


    const handleWheel = (e) => {
           e.preventDefault();
           const zoomSpeed = 0.3;
           const newZoom = e.deltaY > 0 ? zoomLevel - zoomSpeed : zoomLevel + zoomSpeed;
           setZoomLevel(Math.min(Math.max(newZoom, 1), 5)); // Clamp zoom level
          
         };


      

    const handleMouseDown = (e) => {
        setIsDragging(false);
        setIsPanning(true);
        setStartPoint({ x: e.clientX - panX, y: e.clientY - panY });
    };

