    const handleMouseMove = (e) => {
        setIsDragging(true);
        if (!isPanning) return;
        const newPanX = e.clientX - startPoint.x;
        const newPanY = e.clientY - startPoint.y;
        const minX = (-(1280 * zoomLevel) + 1000) / 2; 
        const maxX = (1280 * zoomLevel - 1000) / 2;
        const minY = (-(832 * zoomLevel) + 570) / 2;
        const maxY = (832 * zoomLevel - 570) / 2;
        const boundedPanX = Math.min(Math.max(newPanX, minX), maxX);
        const boundedPanY = Math.min(Math.max(newPanY, minY), maxY);
        setPanX(boundedPanX);
        setPanY(boundedPanY);
    };
  
    const handleMouseUp = () => {
      setIsPanning(false);
    };
  
    const resetView = () => {
      setZoomLevel(1);
      setPanX(0);
      setPanY(0);
    };

    const handleNextFloor = () => {
      setCurrentFloor((prev) => {
        const totalFloors = buildingFloors[query]?.totalFloors || 1; // Default to 1 if undefined
        return prev < totalFloors ? prev + 1 : prev;
      });
    };
    
    const handlePreviousFloor = () => {
      setCurrentFloor((prev) => (prev > 1 ? prev - 1 : prev));
    };

